BEGIN
    PROCESS(RST, HCOUNT, VCOUNT)
    BEGIN
        IF (RST = '1') THEN
            RED <= (OTHERS => '0');
            GREEN <= (OTHERS => '0');
            BLUE <= (OTHERS => '0');
        ELSE 
			hcount <= 0;
            vcount <= 0;
			-- calcul du nb_pixel
			FOR i IN HCOUNT'RANGE LOOP
				IF HCOUNT(i) = '1' THEN
					hcount <= hcount + 1; -- Incr√©mentation de hcount si le bit est √† '1'
				END IF;
			END LOOP;
			
			FOR i IN VCOUNT'RANGE LOOP
				IF VCOUNT(i) = '1' THEN
					vcount <= vcount + 1; -- Incr√©mentation de vcount si le bit est √† '1'
				END IF;
			END LOOP;
			-- correspondance des pixel
			IF (hcount < XMAX AND vcount < YMAX) THEN
                RED <= data_vector((YMAX-hcount) * (XMAX-vcount))(0 DOWNTO 3);
                GREEN <= data_vector((YMAX-hcount) * (XMAX-vcount))(4 DOWNTO 6);
                BLUE <= data_vector((YMAX-hcount) * (XMAX-vcount))(7 DOWNTO 11);
            END IF;
        END IF;
    END PROCESS;
END rtl;
